import React from 'react'
import { Link, Outlet } from 'react-router-dom';
import './Layout.css';
import {logo} from '../assets/youtube.png';
const Layout = () => {
  return (
    <div>
      <header>
        <img src={logo} alt=''/>
        <nav>
          <ul>
            <li><Link></Link></li>
            <li><Link></Link></li>
            <li><Link></Link></li>
            <li><Link></Link></li>
          </ul>
        </nav>
        <div className='right_section'>
         <button>Login</button>
        </div>
      </header>
      <Outlet/>
    </div>
  )
}

export default Layout;
